import "./ExpenseItem.css"
const ExpenseItem = () => {
    return (
        <div className="expense-item">
            <div>
                March 2023
            </div>
            <div>
                <h2>Car Insurance</h2>
                <div>$354.25</div>
            </div>
        </div>
    )
}
export default ExpenseItem;
